import { Routes, Route } from 'react-router-dom';
import Home from './pages/Home';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

function App() {
  return (
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/cadastro/doador" element={<div>Página de Cadastro de Doador em construção</div>} />
    </Routes>
  );
}

export default App;
